export const request = async (params = {}) => {
  const requestParam = {
    limits: '100',
    ...params,
  }

  let query = Object.keys(requestParam)
    .map(k => encodeURIComponent(k) + '=' + encodeURIComponent(requestParam[k]))
    .join('&')
  const url = 'https://api.spaceXdata.com/v3/launches'

  console.log('url', url)
  const res = await fetch(url, {
    method: 'GET',
    data: {
      test: 'test',
    },
  })
  const json = await res.json()
  return json
}
